import React from 'react'
import InfoContextProvider from '../InfoContent/PitsaCard/PitsaCard';
import InfoContextProvider1 from '../InfoContent/Sushi/Sushi';
import InfoContextProvider2 from '../InfoContent/Water/Water';
import MainContext from '../InfoContent';
import MainContext2 from '../InfoContent/Sushi/MainContent/MainContent';
import MainContext3 from '../InfoContent/Water/MainContent/MainContent';
import NavbarCard from '../NavbarCard/NavbarCard';
import Address from '../Address/Address';
import Aksiya from '../InfoContent/Aksiya/Aksiya';

export default function Home() {
  return (
    <div className='bg-light'>
        <div className="container-xxl">
        <NavbarCard/>
        <Aksiya/>
        <Address/>
        <InfoContextProvider>
            <h1>Пицца</h1>
            <MainContext/>
        </InfoContextProvider>
        <InfoContextProvider1>
            <h1>Суши</h1>
            <MainContext2/>
        </InfoContextProvider1>
        <InfoContextProvider2>
          <h1>Напитки</h1>
          <MainContext3/>
        </InfoContextProvider2>
        </div>
        
    </div>
  )
}
